Rose was driving on her way to the beach when her car started to feel a little funny, like her brakes were giving way. She ended up having to pull over and call for some help. She was gonna call her brother but instead she ended up calling VooDoo who came to her rescue. The beach plans were somewhat out of the question now and instead they were going to go back to her place and hang out for a bit. And since VooDoo came to the rescue Rose had a nice surprise waiting for him, A deep throat and a big juicy ass, which VooDoo took full advantage of. The girl really is a champ because she really deep throated VooDoo the best Ive seen anyone ever do it. Definitely one for your records. Enjoy!
